import React from "react";
import { useRouteError } from "react-router-dom";
const Error = ()=>{
    const error = useRouteError();
    console.log(error);
    return (
        <div className="Error">
            <h1>Opps Error</h1>
            <h2>{error.statusText}</h2>
        </div>
    )
}
export default Error;
